                        console.log(res);
                        if (res.data !== true) {
                          alert('ÏÇ¨Ïö© Í∞ÄÎä•Ìïú Î≤àÌò∏ÏûÖÎãàÎã§.');
                          setCheckedPhone(true);
                        } else {
                          alert('ÏÇ¨Ïö© Î∂àÍ∞ÄÎä•Ìïú Î≤àÌò∏ÏûÖÎãàÎã§.');
